'Review your settings'=>'Skontrolovanie nastavení',
'GetStartedSettings'=>'Post Affiliate Pro je vytvorený tak, aby mohol pracovať aj s predvolenými nastaveniami, avšak doporučujeme vám skontrolovať všetky nastavenia a vylepšiť systém tak, ako ho potrebujete. Všetky systémové nastavenia nájdete v sekcií <strong>Nastavenia</strong>.<br/><br/>Podrobný popis nastavenia nájdete v <a href="http://support.proviznysystem.sk/podpora" target="_blank">používateľskej príručke</a>.',
'Define your commissions'=>'Definovanie provízií',
'GetStartedCommissions'=>'Počas inštalácie je vytvorená jedná predvolená kampaň, ktorú môžete upraviť alebo si môžete vytvoriť svoju vlastnú.<br/><br/>
Kampane sú použité na zoskupenie produktov, ktoré majú rovnakú výšku provízií.<br/><br/>
Napríklad  môžete mať kampaň pre Produkt1, kde budete odmeňovať partnerov za kliknutie a v druhej kampani za produkt 2, kde partneri získajú provízie sa uskutočnené predaje<br/><br/>',
'Add banners and other creatives'=>'Pridanie banerov a iných materiálov',
'GetStartedCreatives'=>'V <strong>Správcovi banerov</strong> môžete vytvoriť množstvo propagačných materiálov ako sú textové odkazy, štandardné obrázkové baneri, HTML baneri a propagačné emaily.<br/>
Každý baner musí mať určenú cieľovú adresu. Je to adresa, na ktorú bude návštevník presmerovaný po kliknutí.',
'Set up emails'=>'Nastavenie E-mailov',
'GetStartedEmails'=>'Nemali by ste zabudnúť nastaviť správnu E-mail funkcionalitu, ktorá zahŕňa:<br/><br/><ul><li><strong>E-mailový účet</strong> - určuje spôsob odosielania E-mailov. Môžete použiť PHP mail() funkciu alebo SMTP server.</li><br/><li><strong>Šablóny E-mailov</strong> - tieto šablóny sú použité v E-mailoch, ktoré sú automaticky odoslané systémom ako napríklad E-mail po registrácií alebo oznámenie o uskutočnenom predaji.</li><br/><li><strong>Oznámenia na E-mail</strong> - môžete si nastaviť, aké typy oznámení chcete dostávať na E-mail. Tieto oznámenia môžete nastaviť zvlášť pre obchodníkov a aj zvlášť pre partnerov</li><br/></ul>Pred tým ako spustíte váš systém do prevádzky sa uistite, že odosielanie E-mailov funguje správne.',
'Customize your affiliate signup form'=>'Prispôsobenie registračného formuláru',
'GetStartedSignupForm'=>'Pozrite si štandardný registračný formulár a ak chcete, prispôsobte si ho podľa seba.<br/><br/>
Registračný formulár obsahuje informačnú mini stránku, ktorá informuje napr. partnerskom programe.<br/>Ak túto stránku nepotrebujete, môžete ju odstrániť a použiť iba registračný formulár.
',
'Customize affiliate panel'=>'Prispôsobenie programu',
'GetStartedAffPanel'=>'Partnerský program v Post Affiliate Pro je veľmi flexibilný. Môžete si určiť, ako bude vaše menu vyzerať a tak isto aj čo bude obsahovať. Do položiek môžete napísať svoj vlastný obsah alebo môžete použiť odkazy na iné stránky.',
'GetStartedIntegrate'=>'Integrácia je spôsob, ako prepojiť provízny systém s vašou aktuálnou stránkou, elektronickým obchodom alebo platobnou bránou za účelom upovedomiť provízny systém o odporúčanom predaji.<br/>
Keď systém dostane notifikáciu, zaregistruje predaj, nájde odkazujúceho partnera (ak existuje) a vytvorí pre neho príslušnú províziu.<br/><br/>
Integrácia obvykle znamená vloženie niekoľkých riadkov kódu do vašej stránky. Je to jednoduchý proces, ktorý je krok za krokom popísaný pre väčšinu systémov. ',
'Test everything'=>'Otestovanie systému',
'GetStartedTest'=>'Keď máte nastavené kampane, definované provízie a vytvorené banere/odkazy, mali by ste systém otestovať.<br/>
Najlepší spôsob ako systém skontrolovať je nesimulovať celý proces z pohľadu partnera:
<ol>
<li>Zaregistrujte sa ako testovací partner. Po schválení by ste mali dostať potvrdzujúci eMail s vašim heslom a mali by ste byť schopný sa prihlásiť do panela partnerov.</li>
<li>Po prihlásení do panela partnerov získajte kód banera/odkazov a vložte ho do testovacej stránky</li> 
<li>Kliknite na baner a skontrolujte, či bolo zaznamenané kliknutie</li>
<li>Po kliknutí skúste spraviť testovací predaj a skontrolujte, či bola vytvorená provízia a či bola priradená správnemu partnerovi.</li>
</ol>

Ak narazíte na nejaký problém, zapnite <strong>Zaznamenávanie udalostí</strong> a pozrite sa na <strong>Riešenie problémov/strong>',
'Promote your affiliate program'=>'Propagácia partnerského programu',
'GetStartedPromote'=>'Po úspešnom otestovaní integrácie provízneho systému s vašou stránkou všetko je pripravené na začatie propagácie vášho partnerského programu, čím zaujmete nových partnerov na pripojenie.<br/><br/>
Na vašu stránku by ste mali vložiť registračný formulár alebo aspoň odkaz na váš partnerský program. Odkazy ako Partnerský program, Zarobte snami peniaze a podobne motivujú nových návštevníkov, aby sa stali vašimi partnermi. <br/><br/>
Aby ste získali viac partnerov, publikujte články o vašom programe, použite inzerciu alebo použite osvedčenú formu propagácie, ktorou je pridanie programu do do databázy partnerských programov. ',
